import React from "react";
import NotificationsActiveIcon from '@material-ui/icons/NotificationsActive';

const Notice = () => {

    return(
        <>
<section>
            <div className="container">
                <div className="notice">
            <a href="https://www.bitsindri.ac.in" className=" text-white text-decoration-none bg-danger" > 
            for latest announcement and notices, click here...
            <NotificationsActiveIcon/></a>
            </div>
            </div>
            <br/><br/>
         </section>

        </>
    );
};

export default Notice;
